import react , {Component} from 'react';

 class Message extends Component {

    constructor(){
        super()
        this.state = {
            message : 'hello hamza'
        }
    }

    onMessageChange(){
        this.setState({message : 'hello subscriber'})
    }

    render(){
        <>
        <h1>{this.state.message}</h1>
        <button onClick={() => onMessageChange() }>change</button>
        </>
    }
}
